import React from 'react';

function TableRow(props){
    return(
        <>
            {props.files.map((value, index) => (
                          <tr key={index}>
                            <td>{value['name']}</td>
                            <td>^ -</td>
                          </tr>
                        ))
            }
        </>
    );
}

export default TableRow;
